function destroyBlock(x, y, z) {
	if(Level.getGameMode() == 0) {
		if(achievement.openInventory == 1 && achievement.mineWood == 0) {
			if(getTile(x, y, z) == 17 || getTile(x, y, z) == 162) {
				var id = getTile(x, y, z);
				var data = Level.getData(x, y, z);
				if(id == 17) data %= 4;
				if(id == 162) data %= 2;
				setTile(x, y, z, 0);
				woodDroppedItems[woodDroppedItems.length] = Level.dropItem(x + 0.5, y + 0.5, z + 0.5, 0.5, id, 1, data);
			}
		} if(achievement.acquireIron == 1 && achievement.diamonds == 0 && getTile(x, y, z) == 56) {
			updateAchPopup("diamonds");
		}
	}
}

function attackHook(attacker, victim) {
	if(attacker == getPlayerEnt() && achievement.enchantments == 1 && achievement.overkill == 0) {
		var initHealth = Entity.getHealth(victim);
		ctx.runOnUiThread(new Runnable({
			run: function() {
				var bgHandler = new Handler();
				bgHandler.postDelayed(new Runnable({
					run: function() {
						var finalHealth = Entity.getHealth(victim);
						if(initHealth - finalHealth >= 18) {
							updateAchPopup("overkill");
						}
					}
				}), 10);
			}
		}));
	} if(attacker == getPlayerEnt()) {
		var initHealth = Entity.getHealth();
		ctx.runOnUiThread(new Runnable({
			run: function() {
				var dHandler = new Handler();
				dHandler.postDelayed(new Runnable({
					run: function() {
						var finalHealth = Entity.getHealth(victim);
						statistic.general.damageDealt += (initHealth - finalHealth);
					}
				}), 10);
			}
		}));
	} if(victim == getPlayerEnt()) {
		var initHealth = Entity.getHealth(getPlayerEnt());
		ctx.runOnUiThread(new Runnable({
			run: function() {
				var dHandler = new Handler();
				dHandler.postDelayed(new Runnable({
					run: function() {
						var finalHealth = Entity.getHealth(getPlayerEnt());
						statistic.general.damageTaken += (initHealth - finalHealth);
					}
				}), 10);
			}
		}));
	}
}

